import React from "react";
import './index.css';
import './styles/styles.css'
import { BrowserRouter, Route, Switch } from 'react-router-dom'

import Navbar from './components/navbar/Navbar';
import Home from './components/home/Home';
import Footer from './components/navbar/Footer';
import BrowseMovies from "./components/browseMovies/BrowseMovies";
import MovieDetails from './components/browseMovies/MovieDetails';

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <Navbar />

          <Switch className="main">
            <Route exact path="/" component={Home} />
            <Route path="/browse-movies" component={BrowseMovies} />
            <Route path="/movie/:slug" component={MovieDetails} />
          </Switch>
          <Footer />
        </div>
      </BrowserRouter>

    );
  }
}

export default App;
